import React, { useEffect, useState } from "react";
import './DisplaySpiceMerchant.css';

function DisplaySpiceMerchant() {
  const [merchants, setMerchants] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5001/getAllSpiceMerchants", {
      method: "GET",
      headers: { "Content-Type": "application/json" }
    })
      .then((res) => res.json())
      .then((data) => setMerchants(data))
      .catch((err) => console.error("Error fetching merchants:", err));
  }, []);

  return (
    <div className="table-container">
      <h2>Submitted Merchant Applications for Franchise</h2>
      {merchants.length > 0 ? (
        <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Spices</th>
              <th>Experience</th>
              <th>Store Location</th>
              <th>Phone Number</th>
            </tr>
          </thead>
          <tbody>
            {merchants.map((m, i) => (
              <tr key={i}>
                <td>{m.name}</td>
                <td>{m.spices}</td>
                <td>{m.experience}</td>
                <td>{m.storeLocation}</td>
                <td>{m.phoneNumber}</td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No merchants found</p>
      )}
    </div>
  );
}

export default DisplaySpiceMerchant;







